import React from 'react';
import Typography from '@material-ui/core/Typography';
import 'typeface-roboto';
const Home = () => (
  <div>
    <Typography variant="h1" align = 'center'>
    Home
    </Typography>
    <Typography align = 'center'>
    If you're logged in, navigate to the Account page to customize your profile or <a href="http://localhost:3000/admin">Chatroom</a> to start watching and chatting with friends.
    </Typography>
    <Typography align = 'center'>
    If you're not logged in, sign in or sign up to start your session.
    </Typography>
  </div>
);

export default Home;
